import React from 'react';
import Sidebar from './Sidebar';
import './Sidebar.css';

const Dashboard = () => {
  return (
    <div className="dashboard-container">
      <Sidebar />
      <div className="main-content">
        <h1>Dashboard</h1>
        {/* Other dashboard content */}
      </div>
    </div>
  );
};

export default Dashboard;
